description:
Get your geek on! Tanya Tate and her gal pals are excited for Comic Con! Before Tanya suits up in a sexy superhero cosplay costume she has a naughty dream of being a super villain! Super starlet Amanda Tate is strapped down in Tanyas laboratory where she is given an orgasmic full body physical. When the fantasy comes to an end, Tanya checks on Annie Cruz who would rather play with her geek girlfriend, Catie Parker, in the shower before gearing up to go. Tanya is not the only one with dirty thoughts, as gamer girl Ela Darling has her own hot and heavy fantasy that involves being dominated by seductress Nicki Hunter. After a day of geeking out, Tanya comes home with her bag of comic book swag to see sexy Zoey Holloway has set up a naughty horny birthday party that involves a three way with Cassie Laine lassoed in a bow. The women wear the capes and the girls get roped.

